import React, { Component } from "react";
import logo from "./logo.jpeg";
import { Link, animateScroll as scroll } from "react-scroll";

export default class Navbar extends Component {
	render() {
		return (
			<nav className="nav" id="navbar">
				<div className="nav-content">
					<img
						src={logo}
						className="nav-logo"
						alt="Logo."
						onClick={this.scrollToTop}
					/>
					<ul className="nav-items">
						Section 1
						<li className="nav-item">
							<Link
								activeClass="active"
								to="section1"
								spy={true}
								smooth={true}
								offset={-70}
								duration={500}></Link>
						</li>
						<li className="nav-item">
							Section 2
							<Link
								activeClass="active"
								to="section2"
								spy={true}
								smooth={true}
								offset={-70}
								duration={500}></Link>
						</li>
						<li className="nav-item">
							Section 3
							<Link
								activeClass="active"
								to="section3"
								spy={true}
								smooth={true}
								offset={-70}
								duration={500}></Link>
						</li>
						<li className="nav-item">
							Section 5
							<Link
								activeClass="active"
								to="section4"
								spy={true}
								smooth={true}
								offset={-70}
								duration={500}></Link>
						</li>
						<li className="nav-item">
							Section 5
							<Link
								activeClass="active"
								to="section5"
								spy={true}
								smooth={true}
								offset={-70}
								duration={500}></Link>
						</li>
					</ul>
				</div>
			</nav>
		);
	}
}
